Attribute.code:
void read_sensor() {
	if(in.read() == 0) {
		out.write(in_left.read());
		//cout << "Reading sensor left: " << in_left.read() << "@ " << this->get_time() << endl;
	}
	else if(in.read() == 1) {
		out.write(in_front.read());
		//cout << "Reading sensor front: " << in_front.read() << "@ " << this->get_time() << endl;
	}
	else if(in.read() == 2) {
		out.write(in_right.read());
		//cout << "Reading sensor right: " << in_right.read() << "@ " << this->get_time() << endl;
	}
}

Attribute.processCode:
void processing() {
	if(in.read() != 0) {
		out.write(rand() % 30);
	}
	else {
		cout << "Temp sensor is off. @ " << this->get_time() << endl;
	}
}
